import React,{Component}from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Navbar from '.././Components/Navigation/Navbar'
import EmployeeDetails from '../Components/Details/EmployeeDetails';
import Landing from '../Components/Landing/Landing';
import Logout from '../Services/AuthenticationServices/Logout';

class DesktopRouter extends Component {
  render(){   
        return (
            <div className="TodoApp">
                <Router>        
                    <Navbar />
                    <Switch>           
                    <Route path='/employeeDetails' component={EmployeeDetails} />   
                    <Route path='/logout' component={Logout} /> 
                    <Route path='/updateEmployeeDetail/:id' component={UpdateRecord} />
                    <Route exact path="/logout" component={Landing}/>     
                    {/* <Route path='/create' component={PostRecords} />
                    <Route path='/update_record/:id' component={UpdateRecord} />
                    <Route path='/search_view/:id' component={SearchView} /> */}
                    
                    </Switch>
                </Router>           
            </div>
        )
  }
}

export default DesktopRouter;
